content.css:
.filtro-conjugado {
  position: relative;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.filtro-conjugado .list-container {
  position: absolute;
  inset: 0;
  overflow-y: auto;
  /* rolagem vertical */
  padding: 6px;
  user-select: text;
  /* permite copiar */
}
.filtro-conjugado .list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.filtro-conjugado .item {
  display: block;
  padding: 6px 8px;
  cursor: pointer;
  line-height: 1.25;
  word-break: break-word;
  /* quebra no fim da largura */
  white-space: normal;
  border-radius: 6px;
}
.filtro-conjugado .item:hover {
  background: rgba(0, 0, 0, 0.06);
}
.filtro-conjugado .item.selected {
  background: rgba(0, 0, 0, 0.12);
  font-weight: 600;
}
.filtro-conjugado .empty {
  opacity: 0.7;
  font-style: italic;
}
